import PopupMassege from './PopupMassege';
import success from '../images/success.png';

export default function SuccessMassege(props) {
  return (
    <div className={props.isOpen ? `popup ` : `popup  popup-hidden`}>
      <PopupMassege
        icon={success}
        massege='Success! You have now been registered.'
        onClose={props.onClose}
      />
    </div>
  );
}
